import React from "react";
import { Radar } from "react-chartjs-2";
import Data from "../Data/DimensionActive";
const data1 = Data;

const radarData = {
  labels: [
    "HP",
    "ฮันโหลฮ่า",
    "ผู้นะนิ",
    "Sp. Attack",
    "Sp. Def",
    "Speed",
    ",มานิทร์",
    "สุรินืรทร์",
    "ก็มาดิคร๊าบ",
  ],
  datasets: [
    {
      backgroundColor: "rgba(255,99,132,0.2)",
      borderColor: "rgba(255,99,132,1)",
      pointBackgroundColor: "rgba(255,99,132,1)",
      pointBorderColor: "#fff",
      pointHoverBackgroundColor: "#fff",
      pointHoverBorderColor: "rgba(255,99,132,1)",
      pointBackgrounColor: "rgba(255, 153, 51, 1)",

      data: [
        parseFloat(data1[0].d0),
        parseFloat(data1[1].d0),
        parseFloat(data1[2].d0),
        parseFloat(data1[3].d0),
        parseFloat(data1[4].d0),
        parseFloat(data1[5].d0),
        parseFloat(data1[6].d0),
        parseFloat(data1[7].d0),
        parseFloat(data1[8].d0),
      ],
    },
  ],
};

const ChartPage = (props) => {
  return (
    <div>
      <Radar data={radarData} />
    </div>
  );
};

export default ChartPage;
